import Header from './header'
import Content from './content'
import Footer from './footer'
import { set, ref } from 'firebase/database'
import { dataB } from './firebaseconfig'

function App() {  

  function WriteData() {
    set(ref(dataB, `tester`), {
        itemLocation: 'TEST D4', 
        boolean: false
    });
}
WriteData()
  return (
    <div className="App">
      <Header/>
      <Content/>
      <Footer/>

    </div>
  );
}

export default App;
